// VideoComponent.js
import React from 'react';

const VideoComponent = ({ video, removeVideo, upVote, downVote }) => {
  const { id, title, url, votes } = video;

  return (
    <div>
      <h2>{title}</h2>
      <iframe width="560" height="315" src={url} title={title} frameBorder="0" allowFullScreen></iframe>
      <p>Votes: {votes}</p>
      <button onClick={() => removeVideo(id)}>Remove Video</button>
      <button onClick={() => upVote(id)}>Up Vote</button>
      <button onClick={() => downVote(id)}>Down Vote</button>
    </div>
  );
};

export default VideoComponent;
